import InvestmentView from "./InvestmentView";
import React from "react";

const PRICING = [
  {
    type: "Elopment",
    price: "$1200",
    detail: "2 hours", 
  },
  {
    type: "Engagement",
    price: "$500",
    detail: "1 hour", 
  },
  {
    type: "Branding",
    price: "$750",
    detail: "3 hours", 
  },
]


const Investment = () => {
  return (
    <Investment detail={PRICING}/>
  );
};

export default Investment;
